import React from 'react';
import { Container, Typography, Paper, Card, CardContent } from '@mui/material';

const Projects = () => {
  // Replace with your project data
  const projects = [
    { title: 'Smart Product Manager', description: 'Developed a website using...' },
    // Add more projects
  ];

  return (
    <Paper elevation={3} sx={{ padding: 2, margin: 2 }}>
      <Container>
        <Typography variant="h4" gutterBottom>Projects</Typography>
        {projects.map(project => (
          <Card key={project.title} sx={{ marginBottom: 2 }}>
            <CardContent>
              <Typography variant="h6">{project.title}</Typography>
              <Typography variant="body2">{project.description}</Typography>
            </CardContent>
          </Card>
        ))}
      </Container>
    </Paper>
  );
};

export default Projects;
